To make your script more streamlined and parameterized, we can use a for loop to iterate over the predefined `parent_ids`. For each iteration, we perform the same series of insertions while updating the IDs dynamically. 

Here is an improved version of your script:

```postgresql
DO $$
DECLARE
    parent_id UUID;
    codebook_id UUID;
    value_id UUID;
    child_codebook_id UUID;
    child_value_id UUID;
BEGIN
    FOR parent_id IN 
        SELECT unnest(array[
            'e408a8b1-390a-4eb5-b9fe-b34dd32e76de',  -- personal
            '28c125b1-e905-4fbf-bea2-53f90ebbd2b8',  -- motorcycle
            '7b5407bb-777d-44c5-b168-17a2ce61355e'   -- utility
        ])
    LOOP
        -- Insert codebook entry
        PERFORM uuid_generate_v4();
        codebook_id := uuid_generate_v4();
        IF parent_id = 'e408a8b1-390a-4eb5-b9fe-b34dd32e76de' THEN
            INSERT INTO codebook (id, source, code, parent_id)
            VALUES (codebook_id, 'RIXO', 'vehicletype.personal', parent_id)
            ON CONFLICT DO NOTHING;

            -- Insert value
            value_id := 'e942d0a9-dfdd-40d0-b542-a06bb38f5871';
            INSERT INTO value (id, codebook_id, code, value)
            SELECT value_id, codebook_id, '-1000', 'Ostatní'
            FROM codebook WHERE id = codebook_id;

            -- Insert attributes
            INSERT INTO attribute (id, codebook_value_id, code, value)
            VALUES (uuid_generate_v4(), value_id, 'external.id.POSITIVE', '34'),
                   (uuid_generate_v4(), value_id, 'vehicle.brand.other', 'true');

            -- Insert child codebook
            child_codebook_id := '530d8f35-4ae3-4114-a775-63ac571a7f93';
            value_id := '78a1bffa-9be5-45ae-a013-e1c915b74ad2';
            INSERT INTO codebook (id, source, code, parent_id)
            VALUES (child_codebook_id, 'RIXO', 'vehicletype.personal.other', value_id);

        ELSIF parent_id = '28c125b1-e905-4fbf-bea2-53f90ebbd2b8' THEN
            INSERT INTO codebook (id, source, code, parent_id)
            VALUES (codebook_id, 'RIXO', 'vehicletype.motorcycle', parent_id)
            ON CONFLICT DO NOTHING;

            -- Insert value
            value_id := '337b3b82-04bb-4e98-a789-b782a680c0f5';
            INSERT INTO value (id, codebook_id, code, value)
            SELECT value_id, codebook_id, '-1000', 'Iná značka'
            FROM codebook WHERE id = codebook_id;

            -- Insert attributes
            INSERT INTO attribute (id, codebook_value_id, code, value)
            VALUES (uuid_generate_v4(), value_id, 'external.id.POSITIVE', '34'),
                   (uuid_generate_v4(), value_id, 'vehicle.brand.other', 'true');

            -- Insert child codebook
            child_codebook_id := '51e9618c-aa74-47d7-a75b-8bcf7f9ea955';
            child_value_id := '2de48239-c0b2-4e0d-8e5a-a5071d9b7f40';
            INSERT INTO codebook (id, source, code, parent_id)
            VALUES (child_codebook_id, 'RIXO', 'vehicletype.motorcycle.other', value_id);

        ELSE
            INSERT INTO codebook (id, source, code, parent_id)
            VALUES (codebook_id, 'RIXO', 'vehicletype.utility', parent_id)
            ON CONFLICT DO NOTHING;

            -- Insert value
            value_id := '4911f9b4-658a-4897-81d4-7052dc013fcd';
            INSERT INTO value (id, codebook_id, code, value)
            SELECT value_id, codebook_id, '-1000', 'Iná značka'
            FROM codebook WHERE id = codebook_id;

            -- Insert attributes
            INSERT INTO attribute (id, codebook_value_id, code, value)
            VALUES (uuid_generate_v4(), value_id, 'external.id.POSITIVE', '34'),
                   (uuid_generate_v4(), value_id, 'vehicle.brand.other', 'true');

            -- Insert child codebook
            child_codebook_id := uuid_generate_v4();
            child_value_id := '356d640a-e819-4c76-a3c9-ff9ad12fa461';
            INSERT INTO codebook (id, source, code, parent_id)
            VALUES (child_codebook_id, 'RIXO', 'vehicletype.utility.other', value_id);
        END IF;

        -- Insert value for child codebook
        INSERT INTO value (id, codebook_id, code, value)
        VALUES (child_value_id, child_codebook_id, '-2000', 'Ostatné');

        -- Insert attributes for the child value
        INSERT INTO attribute (id, codebook_value_id, code, value)
        VALUES (uuid_generate_v4(), child_value_id, 'external.id.POSITIVE', '1906'),
               (uuid_generate_v4(), child_value_id, 'vehicle.model.other', 'true');
    END LOOP;
END $$;
```

In this code:

- We have defined an anonymous block using `DO $$`.
- Loop over predefined `parent_id` values and dynamically insert the respective SQL entries.
- Values for `codebook_id`, `value_id`, `child_codebook_id`, and `child_value_id` are generated as UUIDs within the loop.
- This refactor reduces redundancy and allows for better maintainability and readability.

