               (uuid_generate_v4(), value_id, 'vehicle.brand.other', 'true'),
               (uuid_generate_v4(), value_id, 'drools.id', drools_id_value::text);

        -- Update drools_id_value by incrementing by 10 for the next value
        drools_id_base := drools_id_base + 10;

        -- Insert child codebook
        child_codebook_id := uuid_generate_v4();
        INSERT INTO codebook (id, source, code, parent_id)
        VALUES (child_codebook_id, 'RIXO', codebook_code || '.other', value_id);

        -- Insert value for child codebook
        child_value_id := uuid_generate_v4();
        drools_id_value := drools_id_base + 1000;  -- Set the base for child
        INSERT INTO value (id, codebook_id, code, value)
        VALUES (child_value_id, child_codebook_id, '-2000', 'Ostatné');

        -- Insert attributes for the child value
