        VALUES (uuid_generate_v4(), child_value_id, 'external.id.POSITIVE', '1906'),
               (uuid_generate_v4(), child_value_id, 'vehicle.model.other', 'true'),
               (uuid_generate_v4(), child_value_id, 'drools.id', drools_id_value::text);

        -- Update drools_id_base by incrementing the base by 10 for the next series
        drools_id_base := drools_id_base + 10;
    END LOOP;
END $$;
