   ```

2. **Check Conflict Handling:**

   If the `codebook_id` gets inserted with `ON CONFLICT DO NOTHING` in the `codebook` table, there could be cases where `codebook_id` is not available (when there is a conflict), which results in the subsequent insertion into the `value` table failing silently. To handle such cases, verify if the insertion actually happened by performing a SELECT operation afterward:

   ```sql
   -- After inserting into the codebook table:
   PERFORM id FROM codebook WHERE id = codebook_id;

   -- If the record exists, then proceed with the value insertion:
   IF FOUND THEN
       INSERT INTO value (id, codebook_id, code, value)
       VALUES (value_id, codebook_id, code_id_value::text, 'Iná značka');
   END IF;
   ```

